import React from "react";
import { useParams, useLocation } from "react-router-dom";

const User = () => {

  let { val, newval } = useParams();
  let location = useLocation();


  return (
    <>
      <h1> User {val} {newval}  Page</h1>
      <h1> Location: {location.pathname}  Page</h1>
      if(location.pathname==`/user/me/him`)?
      return <button>click</button> : null
    </>
  )
}

export default User;
